export const ADD_TO_FAVORITE = "ADD_TO_FAVORITE";
export const REMOVE_FROM_FAVORITE = "REMOVE_FROM_FAVORITE";
export const GET_FAVORITE_WEATHER_LIST = "GET_FAVORITE_WEATHER_WEATHER_LIST";

export const SET_WEATHER_DATA = "SET_WEATHER_DATA";
export interface SetWeatherAction {
	type: typeof SET_WEATHER_DATA;
	payload: WeatherData;
}

export const GET_WEATHER_DATA = "GET_WEATHER_DATA"; // <=> 'GET_CITY_WEATHER';
export interface GetWeatherAction {
	type: typeof GET_WEATHER_DATA;
	query: string;
}

export const GET_WEATHER_REQUEST = "GET_WEATHER_REQUEST";
export interface GetWeatherRequestAction {
	type: typeof GET_WEATHER_REQUEST;
}
export const GET_WEATHER_ERROR = "GET_WEATHER_ERROR";
export interface GetWeatherErrorAction {
	type: typeof GET_WEATHER_ERROR;
	error: Error | string;
}
export const GET_WEATHER_SUCCESS = "GET_WEATHER_SUCCESS";
export interface GetWeatherSuccessAction {
	type: typeof GET_WEATHER_SUCCESS;
	payload: WeatherData;
}

export interface WeatherData {
	id: number;
	weather:
		| "Clouds"
		| "Rain"
		| "Clear"
		| "Smoke"
		| "haze"
		| "dust"
		| "mist"
		| "sand"
		| "thunderstorm";
	temp: number;
	humidity: number;
	country: string;
	wind: number;
}

export type WeatherActions =
	| SetWeatherAction
	| GetWeatherAction
	| GetWeatherRequestAction
	| GetWeatherSuccessAction
	| GetWeatherErrorAction;
